import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(props){
    super(props);

    this.state = {
      loading: false
    };
  }


  render() {
    const loadingSpin = this.state.loading ? "App-logo Spin" : "App-logo";
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className={loadingSpin} alt="logo" />
          <h1 className="App-title">
            Run Analyzer
          </h1>
          <p>This webapp allows you to understand what shape you are in based on your last run pace.</p>
        </header>

        <div className="Row">
          <div className="App-column-form">
            <h2>Run Information</h2>
            {/* Form Component */}
          </div>
          <div className="App-column-feed">

            {/* Run feed Component */}
          </div>
        </div>


      </div>
    )
  }
}
